import {useSelector} from "react-redux"
import {useNavigate} from "react-router-dom"
// import {useEffect} from "react"

const Home = () => {
    const navigate = useNavigate()
    const auth = useSelector(state => state.auth)

    // useEffect(() => {

    //     if(!auth._id) {
