    //     }
    // }, [auth._id, navigate])

    return (
        <div>
            <div className="home">
                <div className="home_container">
                    <Sidebar />
                    <Feed />
                    <Rightbar />
                </div>
            </div>
        </div>
    )
}

export default Home
